export default function Sidebar(){

    const [pokeData, setPokedata] = React.useState()

    React.useEffect(() => {
        fetch("https://pokeapi.co/api/v2/pokemon/1")
            .then(res => res.json())
            .then(data => setPokedata)
    }, [])



    return( 
        <>
<div id="sidebar">
<div id="searchbox-div">
<input type="searchbox" id="searchbox" placeholder="Search"></input>
</div>


{ JSON.stringify( pokeData)}



</div>
        </>
    )
}
